CortanaConsentPanel.Description:
Щоб отримати відповідь на запитання, потрібно пам’ятати важливі фактори, а також надати Cortana дозвіл на збирання та використання даних, зокрема:

даних про розташування і відповідну історію;

контактів, відомостей календаря, вмісту та історії спілкування в повідомленнях, миттєвих повідомлень і програм;

історії пошуку та іншої інформації пристрою, щоб персоналізувати роботу програми.
